css:
/*
@cyan:         #35a766;
@blue:         #5977d3;
@purple:       #8100c6;
@green:        #8fad06;
@red:          #d24d4d;
@orange:       #cd8e21;
@light-orange: #e3a92d;
*/
atom-text-editor,
atom-text-editor::shadow,
:host {
  background-color: #f8f6f1;
  color: #2b3f6a;
}
atom-text-editor .line.cursor-line,
atom-text-editor::shadow .line.cursor-line,
:host .line.cursor-line {
  background-color: rgba(228, 220, 200, 0.2);
}
atom-text-editor .wrap-guide,
atom-text-editor::shadow .wrap-guide,
:host .wrap-guide {
  background-color: #e0dad3;
}
atom-text-editor .indent-guide,
atom-text-editor::shadow .indent-guide,
:host .indent-guide {
  color: rgba(169, 193, 214, 0.7);
}
atom-text-editor .invisible-character,
atom-text-editor::shadow .invisible-character,
:host .invisible-character {
  color: rgba(169, 193, 214, 0.7);
}
atom-text-editor .gutter-container,
atom-text-editor::shadow .gutter-container,
:host .gutter-container {
  margin-right: 0.8em;
}
atom-text-editor .gutter,
atom-text-editor::shadow .gutter,
:host .gutter {
  background-color: #e0dad3;
  color: #2a120a;
}
atom-text-editor .gutter .line-number,
atom-text-editor::shadow .gutter .line-number,
:host .gutter .line-number {
  -webkit-font-smoothing: antialiased;
}
atom-text-editor .gutter .line-number.cursor-line,
atom-text-editor::shadow .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #c7bcaf;
  color: #2a120a;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
atom-text-editor::shadow .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #2a120a;
}
atom-text-editor .line-number.folded,
atom-text-editor::shadow .line-number.folded,
:host .line-number.folded,
atom-text-editor .line-number:after,
atom-text-editor::shadow .line-number:after,
:host .line-number:after,
atom-text-editor .fold-marker:after,
atom-text-editor::shadow .fold-marker:after,
:host .fold-marker:after {
  color: #255f93;
}
atom-text-editor .selection .region,
atom-text-editor::shadow .selection .region,
:host .selection .region {
  background-color: #e4dcc8;
}
.bracket-matcher .region {
  background-color: rgba(237, 169, 251, 0.61);
}
.comment {
  color: #9ca3b0;
}
.entity.name.type {
  color: #379566;
}
.entity.other.inherited-class {
  color: #8f932b;
}
.keyword {
  color: #8f932b;
}
.keyword.control {
  color: #2b3f6a;
  font-weight: bold;
}
.keyword.operator {
  font-weight: bold;
  color: #1c4b33;
}
.keyword.other.special-method {
  color: #5e78e1;
}
.keyword.other.attribute-name {
  color: #2b3f6a;
  font-weight: bold;
}
.keyword.other.unit {
  color: #8f932b;
}
.storage {
  color: #5e78e1;
}
.storage.todo,
.storage.idea,
.storage.fixme,
.storage.hack {
  color: #8100c6;
  background-color: rgba(227, 169, 45, 0.1);
  text-decoration: none;
  border-bottom: rgba(169, 193, 214, 0.7);
  border-width: 0px 0px 1px 0px;
  border-style: none none dotted none;
}
.constant {
  color: #c16161;
}
.constant.character.escape {
  color: #8f932b;
}
.constant.numeric {
  color: #c16161;
}
.constant.other.color {
  color: #8f932b;
}
.constant.other.symbol {
  color: #8f932b;
}
.variable {
  color: #5e78e1;
}
.variable.interpolation {
  color: #3354d9;
}
.invalid.illegal {
  background-color: #c16161;
  color: #f8f6f1;
}
.string.interpolated {
  background-color: rgba(255, 204, 0, 0.03);
}
.string.quoted {
  background-color: rgba(255, 204, 0, 0.03);
  color: rgba(106, 68, 28, 0.77);
}
.string.regexp {
  color: #379566;
}
.string.regexp .source.ruby.embedded {
  color: #d08e25;
}
.string.other.link {
  color: #c16161;
}
.punctuation.definition.comment {
  color: #808999;
}
.punctuation.definition.tag {
  color: #ac4343;
}
.punctuation.definition.parameters.end,
.punctuation.definition.arguments.end,
.punctuation.definition.parameters.begin,
.punctuation.definition.arguments.begin {
  color: #6e7daa;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #5e78e1;
}
.punctuation.definition.bold {
  color: bold-color;
  font-weight: bold;
}
.punctuation.section.embedded {
  color: #ac4343;
}
.support.class {
  color: #379566;
}
.support.function {
  color: #d08e25;
}
.entity.name.function {
  color: #d08e25;
}
.entity.name.class,
.entity.name.type.class {
  color: #2b3f6a;
}
.entity.name.section {
  color: #c16161;
}
.entity.name.tag {
  color: #5e78e1;
}
.entity.name.label {
  color: #5e78e1;
}
.entity.other.attribute-name {
  color: #d08e25;
}
.entity.other.attribute-name.id {
  color: #5e78e1;
}
.meta.class {
  color: #2b3f6a;
}
.meta.method {
  color: #255f93;
}
.meta.link {
  color: #d08e25;
}
.meta.require {
  color: #5e78e1;
}
.meta.selector {
  color: #d08e25;
}
.meta.separator {
  color: #2b3f6a;
}
.none {
  color: red;
}
/*---------------------------------------
 below: optional extra stuff for addon packages
-----------------------------------------*/
.highlights .highlight-selected .region {
  border-radius: 4px;
  box-sizing: content-box;
  padding: 0 1px 0 0;
  margin: -1px 0 0 -1px;
  background-color: transparent;
  border-width: 1.5px;
  border-style: dashed;
}
.highlights .highlight-selected.light-theme .region {
  border-color: rgba(238, 11, 143, 0.8);
}
.highlights .highlight-selected.light-theme.background .region {
  background-color: rgba(236, 13, 132, 0.35);
}
atom-text-editor[data-grammar="source gfm"]::shadow .gutter-container {
  margin-right: 2em;
}
.markup.changed {
  color: #8100c6;
}
.markup.deleted {
  color: #c16161;
}
.markup.italic {
  color: #0e72aa;
  font-style: italic;
}
.markup.bold {
  color: #0a537b;
  font-weight: bold;
}
.markup.heading .punctuation.definition.heading {
  color: #5e78e1;
}
.markup.inserted {
  color: #8f932b;
}
.markup.list {
  color: #e24129;
  font-weight: bold;
}
.markup.raw {
  background-color: rgba(245, 250, 252, 0.65);
  color: #2a120a;
}
.markup.raw.inline {
  color: #8f932b;
}
.markup.strike {
  text-decoration: line-through;
}
.markup.underline {
  text-decoration: none;
  border-bottom: rgba(169, 193, 214, 0.7);
  border-width: 0px 0px 1px 0px;
  border-style: none none solid none;
}
.markup.heading {
  color: #2a120a;
  font-weight: normal;
}
.markup.heading.heading-1 {
  font-weight: 900;
  opacity: 1.0;
}
.markup.heading.heading-2 {
  font-weight: 800;
  opacity: 0.9;
}
.markup.heading.heading-3 {
  font-weight: 700;
  opacity: 0.85;
}
.markup.heading.heading-4,
.markup.heading.heading-5,
.markup.heading.heading-6 {
  opacity: 0.80;
}
.markup.heading.marker {
  color: rgba(42, 18, 10, 0.55);
}
.gfm .support {
  color: #6e7daa;
}
.gfm .markup.heading {
  font-weight: normal;
}
.gfm.variable {
  color: #5e78e1;
}
.gfm.entity {
  color: #255f93;
}
.gfm.punctuation.definition.begin,
.gfm.punctuation.definition.end {
  color: #6e7daa;
}
.gfm.username {
  color: #aa5c08;
}
.gfm.mention {
  color: rgba(169, 86, 31, 0.43);
}
.gfm.list {
  color: #e24129;
  font-weight: bold;
}
.gfm.critic.addition {
  color: #8f932b;
}
.gfm.critic.addition.marker {
  color: rgba(143, 147, 43, 0.5) !important;
}
.gfm.critic.deletion {
  color: #c16161;
}
.gfm.critic .deletion.marker {
  color: rgba(193, 97, 97, 0.5) !important;
}
.gfm.critic.substitution {
  color: #d08e25;
}
.gfm.critic.substitution.marker {
  color: rgba(208, 142, 37, 0.5) !important;
}
.gfm.critic.substitution.operator {
  color: #a5701d !important;
}
.gfm.critic.comment {
  color: #9ca3b0;
}
.gfm.critic.comment.marker {
  color: rgba(156, 163, 176, 0.5) !important;
}
.gfm.critic.highlight {
  color: #5e78e1;
}
.gfm.critic.highlight.marker {
  color: rgba(94, 120, 225, 0.5) !important;
}
.comment.quote {
  color: rgba(126, 81, 33, 0.77);
  font-style: italic;
}
.comment.quote .italic {
  font-style: italic;
  color: rgba(158, 56, 1, 0.77);
}
.comment.quote .bold {
  color: rgba(126, 81, 33, 0.77);
  font-weight: bold;
}
.pfm.math {
  background: rgba(143, 147, 43, 0.1);
  color: #8f932b;
}
.pfm.math .gfm.support {
  color: #696c1f;
}
.pfm.math .punctuation.arguments {
  color: #c87373;
}
.pfm.math .tex.constant {
  color: #d08e25;
}
.pfm.math .tex.constant.numeric {
  color: #8f932b;
}
.pfm.definition.block {
  background: rgba(94, 120, 225, 0.1);
}
.pfm.footnote {
  color: #2b3f6a;
}
.text.bibtex .entry-key {
  color: #aa5c08;
  font-weight: bold;
}
.text.bibtex .begin,
.text.bibtex .end {
  color: #2b3f6a;
}
.text.bibtex .punctuation.definition.keyword {
  opacity: 0.7;
}
.source .js.brace.round,
.source .js.brace.curly {
  color: #5e6fa0;
}
.source .js.punctuation.terminator.statement {
  color: #255f93;
}
.source .js.delimiter.method.period {
  color: #6e7daa;
}
.source .js.delimiter.object.comma {
  color: #5e6fa0;
}
.source .js.variable.language.js {
  color: #379566;
}
.css .punctuation.separator.key-value {
  color: #255f93;
}
.body.vala {
  color: #2b3f6a;
}
